import React, { useState } from "react";
import "./index.css";



const App = ()=>{

    const [count,setState] = useState(0);
    const IncNumb = ()=>{
        setState(count+10);
    }
    const DecNumb = ()=>{
        setState(count-10);
    }
    return(
        <>
            <div>
                <h1>{count}</h1>
                <button onClick={IncNumb}>+</button>
                <button onClick={DecNumb}>-</button>
            </div>
        </>
    )
};

export default App;
